// This script needs to set answer to 'yes' or 'no' to indicate the state of the activity.
//
// For example,
answer = ifScript();

function ifScript() {
    if (current.order_for.vip) {
        
        current.setValue('approval', 'Approval');
        current.setValue('short_description', 'test');
      
		return 'yes';
    }
	else
		{
	 current.setValue('approval', 'Requested');
    return 'no';
		}
}

